  int dealWith(int symbol) {
    if (stateStackSize < 1) throw(ArrayLowerBoundExceeded);
    if (debugMode) printf("Received symbol no.%d\n", symbol);
    int state = stateStack[stateStackSize - 1];
    struct TableCell cell = table[state][symbol];
    switch(cell.action) {
      case 0:
        throw(SyntaxError);
      case 4:
        return YACC_ACCEPT;
      case 1:
        if (debugMode) printf("Go to state %d\n", cell.target);
        stateStackPush(cell.target);
        return YACC_NOTHING;
      case 2:
        stateStackPush(cell.target);
        if (debugMode) printf("Shift to state %d\n", cell.target);
        if (curAttr != yytext) free(curAttr);
        curAttr = yytext;
        nodes[nodeNum] = (struct Node *)malloc(sizeof(struct Node));
        nodes[nodeNum]->yytext = (char *)malloc(sizeof(char) * strlen(curAttr));
        strcpy(nodes[nodeNum]->yytext, curAttr);
        nodes[nodeNum]->childNum = 0;
        nodeNum++;
        updateSymbolAttr(0);
        return YACC_NOTHING;
      case 3:
        if (debugMode) printf("Reduce by producer %d\n", cell.target);
        switch (cell.target) {
          case 0:
      if (curAttr != yytext) free(curAttr);
      curAttr = (char *)malloc(1024 * sizeof(char));
      out("%s", "r(expr+expr)"); itoa(atoi(symbolAttr[symbolAttrSize-3]) + atoi(symbolAttr[symbolAttrSize-1]), curAttr, 10);
      stateStackPop(3);
      reduceNode(3);
      updateSymbolAttr(3);
      dealWith(137);
      return symbol;
    case 1:
      if (curAttr != yytext) free(curAttr);
      curAttr = (char *)malloc(1024 * sizeof(char));
      out("%s", "r(expr-expr)"); itoa(atoi(symbolAttr[symbolAttrSize-3]) - atoi(symbolAttr[symbolAttrSize-1]), curAttr, 10);
      stateStackPop(3);
      reduceNode(3);
      updateSymbolAttr(3);
      dealWith(137);
      return symbol;
    case 2:
      if (curAttr != yytext) free(curAttr);
      curAttr = (char *)malloc(1024 * sizeof(char));
      out("%s", "r(expr*expr)"); itoa(atoi(symbolAttr[symbolAttrSize-3]) * atoi(symbolAttr[symbolAttrSize-1]), curAttr, 10);
      stateStackPop(3);
      reduceNode(3);
      updateSymbolAttr(3);
      dealWith(137);
      return symbol;
    case 3:
      if (curAttr != yytext) free(curAttr);
      curAttr = (char *)malloc(1024 * sizeof(char));
      out("%s", "r(expr/expr)"); itoa(atoi(symbolAttr[symbolAttrSize-3]) / atoi(symbolAttr[symbolAttrSize-1]), curAttr, 10);
      stateStackPop(3);
      reduceNode(3);
      updateSymbolAttr(3);
      dealWith(137);
      return symbol;
    case 4:
      if (curAttr != yytext) free(curAttr);
      curAttr = (char *)malloc(1024 * sizeof(char));
      
      stateStackPop(3);
      reduceNode(3);
      updateSymbolAttr(3);
      dealWith(137);
      return symbol;
    case 5:
      if (curAttr != yytext) free(curAttr);
      curAttr = (char *)malloc(1024 * sizeof(char));
      curAttr = symbolAttr[symbolAttrSize-1]; /* default operation in fact */
      stateStackPop(1);
      reduceNode(1);
      updateSymbolAttr(1);
      dealWith(137);
      return symbol;
    case 6:
      if (curAttr != yytext) free(curAttr);
      curAttr = (char *)malloc(1024 * sizeof(char));
      curAttr = symbolAttr[symbolAttrSize-1];
      stateStackPop(1);
      reduceNode(1);
      updateSymbolAttr(1);
      dealWith(140);
      return symbol;
    
        }
      default:
        return symbol;
    }
    return YACC_NOTHING;
  }
  
  void printTree(struct Node *curNode, int depth) {
    if (curNode == NULL) return;
    for (int i = 0; i < depth * 2; i++)
      fprintf(treeout, "%c", ' ');
    fprintf(treeout, "%s", curNode->yytext);
    if (curNode->childNum < 1) return;
    fprintf(treeout, "{\n");
    for (int i = 0;i < curNode->childNum; i++) {
      printTree(curNode->children[i], depth+1);
      if (i+1 < curNode->childNum)
        fprintf(treeout, ",");
      fprintf(treeout, "\n");
    }
    for (int i = 0; i < depth * 2; i++)
      fprintf(treeout, "%c", ' ');
    fprintf(treeout, "}");
  }
  
  int yyparse() {
    if (yyout == NULL) yyout = stdout;
    int token;
    stateStackPush(0);
    while (token != YACC_ACCEPT && (token = yylex())) {
      do {
        token = dealWith(token);
      } while (token >= 0);
    }
    if (token == 0) {
      token = EOFIndex;
      do {
        token = dealWith(token);
      } while (token >= 0);
    }
    strcpy(yytext, curAttr);
    if (token == YACC_ACCEPT) {
      treeout = fopen("yacc.tree", "w");
      printTree(nodes[0], 0);
      fclose(treeout);
      return 0;
    }
    else return 1;
  }
  
